        <div>
            <HeaderOne>Welcome to the Experimint!</HeaderOne>
                <p>Yes the spelling error is intentional</p>
            <div>
                <HeaderTwo>
                    Haha, only saw this now.. I assumed it is!
                </HeaderTwo>
            </div>
        </div>
)

export default Welcome;
